import React, { useState, useEffect } from 'react';
import Moment from 'react-moment';
import 'moment-timezone';

export default class Date extends React.Component {
    render() {
        return (
            <Moment format="YYYY/MM/DD">
                1976-04-19T12:59-0500
            </Moment>
        );
    }
}
